import React, { useState } from 'react';

function AddSyllabus() {
  const [syllabus, setSyllabus] = useState({
    semester: '',
    subcode: '',
    name: '',
    category: '',
    effective: '',
    l: '',
    t: '',
    p: '',
    credit: '',
    pdf: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSyllabus((prevSyllabus) => ({
      ...prevSyllabus,
      [name]: value,
    }));
  };

  const handleFileChange = (e) => {
    setSyllabus((prevSyllabus) => ({
      ...prevSyllabus,
      pdf: e.target.files[0],
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, e.g., upload the PDF and save the syllabus details
    console.log(syllabus);
  };

  return (
    <div>
      <h2>Syllabus</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Semester:</label>
          <input type="text" name="semester" value={syllabus.semester} onChange={handleChange} />
        </div>
        <div>
          <label>Subcode:</label>
          <input type="text" name="subcode" value={syllabus.subcode} onChange={handleChange} />
        </div>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={syllabus.name} onChange={handleChange} />
        </div>
        <div>
          <label>Category:</label>
          <input type="text" name="category" value={syllabus.category} onChange={handleChange} />
        </div>
        <div>
          <label>Effective:</label>
          <input type="text" name="effective" value={syllabus.effective} onChange={handleChange} />
        </div>
        <div>
          <label>L:</label>
          <input type="text" name="l" value={syllabus.l} onChange={handleChange} />
        </div>
        <div>
          <label>T:</label>
          <input type="text" name="t" value={syllabus.t} onChange={handleChange} />
        </div>
        <div>
          <label>P:</label>
          <input type="text" name="p" value={syllabus.p} onChange={handleChange} />
        </div>
        <div>
          <label>Credit:</label>
          <input type="text" name="credit" value={syllabus.credit} onChange={handleChange} />
        </div>
        <div>
          <label>PDF File:</label>
          <input type="file" name="pdf" onChange={handleFileChange} />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default AddSyllabus;
